import React from 'react'
import './SideDrawer.css'
import {NavLink} from 'react-router-dom'
import facebook from '../../social_media_images/facebook.png'
import twitter from '../../social_media_images/twitter.png'
import linkedin from '../../social_media_images/linkedin.png'
const SideDrawer=(props)=>{
    let drawerClasses='side-drawer';
    if(props.show)
    {
        drawerClasses='side-drawer open'
    }
    return(
        <nav className={drawerClasses}>
            <ul>
            <li><NavLink exact activeClassName="navbars__link--active" className="navbar__link" to="/">Home</NavLink></li>
                        <li><NavLink exact activeClassName="navbars__link--active" className="navbar__link" to="/features">Features</NavLink></li>
                        <li><NavLink exact activeClassName="navbars__link--active" className="navbar__link" to="/about">About Us</NavLink></li>
                        <li><NavLink exact activeClassName="navbars__link--active" className="navbar__link" to="/contact">Contact</NavLink></li>
                <li>
                    <a href="https://facebook.com" target="blank"><img src={facebook} alt="Facebook"/></a>
                    <a href="https://twitter.com" target="blank"><img style={{paddingLeft:'0.35em'}} src={twitter} alt="Twitter"/></a>
                    <a href="https://linkedin.com" target="blank"><img style={{paddingLeft:'0.35em'}} src={linkedin} alt="LinkedIn"/></a>
                </li>
            </ul>
        </nav>
    )
}
export default SideDrawer;
